package com.compras.compras.usecases;

import org.junit.jupiter.api.Test;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;
import org.springframework.boot.test.web.client.TestRestTemplate;
import org.springframework.http.ResponseEntity;
import static org.assertj.core.api.Assertions.assertThat;
import static org.junit.jupiter.api.Assertions.*;
@SpringBootTest(webEnvironment = SpringBootTest.WebEnvironment.RANDOM_PORT)
class FindByNameUseCaseTest {
    @Autowired
    private TestRestTemplate testRestTemplate;

    @Test
    public void FindByNameUseCaseTest() {
        String expectedResult = "[{\"id\":\"63e5a28a2d660b6cf341fdbe\",\"name\":\"Hambuerguesas  \",\"inInventory\":8,\"enable\":true,\"min\":8,\"max\":200,\"url\":\"data:image/jpeg;base64,\",\"state\":true,\"price\":112000}]";
        String url = "http://localhost:8080/seekByName/Hambuerguesas  ";
        ResponseEntity<String> responseEntity = testRestTemplate.getForEntity(url,String.class);

        assertThat(responseEntity.getBody()).isEqualTo(expectedResult);
    }

}